            k = len(str(x))
            if k == 1:
                d1_digits[x] += y
            else:
                d1_digits[k] += y
                out += y
        for (x, y) in d2.items():
            k = len(str(x))
            if k == 1:
                d2_digits[x] += y
            else:
                d2_digits[k] += y
                out += y
